  \"2013-03-28T01:14:28.028987\",\n\t\"name\": \"twin-cities-metro-hybrid-landcover-2000-raster\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Hybrid Landcover is an attempt to clean
  up the University of Minnesota Remote Sensing Lab's 2000 LandSat Land Cover for
  the Twin Cities 7-county metropolitan area. The most difficult areas for the satellite
  to identify are transitional areas between two cover types. Layers such as the Metropolitan
  Council's Land Use 2000, National Wetlands Inventory, County Biological Survey,
  TLG Roads, MLCCS Grasslands polygons, GAP 2000, DNR Parks boundaries were referenced
  to clarify and correct classifications of cover type.\",\n\t\"license_title\": null,\n\t\"extras\":
